import { Component } from 'react';
import { Grid, Typography, Button } from '@mui/material';
import { motion, AnimatePresence } from 'framer-motion';
import ModalComponent from './ModalComponent';
import './App.css';
import { gsap, InertiaPlugin, Draggable, TextPlugin } from "gsap/all";

class HomePage extends Component {
  constructor(props) {
    super(props);
      this.state = {
        isModalOpen: false,
    };

    this.openModal = this.openModal.bind(this);
    this.closeModal = this.closeModal.bind(this);
  }

  openModal() {
    this.setState(() => ({ isModalOpen: true }));
  }

  closeModal() {
    this.setState(() => ({ isModalOpen: false }));
  }

  componentDidMount() {
    gsap.registerPlugin(Draggable, InertiaPlugin, TextPlugin);

    Draggable.create(".draggable", {
      bounds: ".fullpage-container",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

    Draggable.create(".rotation", {
      type: "rotation",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

     gsap.to(".title-home", {
        duration: 3,
        text: "Jade & Seka",
        ease: "power1.out",
    });
  }


  render() {
    return (
      <div >
      <Grid
      container
      direction="column" // Stack items vertically
      justifyContent="center"
      alignItems="center"
      className="fullpage-container"
      style={{ minHeight: '100vh' }} // Center vertically in viewport
      >
      {/* Top two images */}
            <Grid container direction="row" justifyContent="center" spacing={2}>
              <Grid item>
                <motion.img
                    src={require('./disco ball 1.png')}
                    alt="world 5"
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    className="draggable image-context"
                    transition={{ duration: 3 }}
                />
              </Grid>
              <Grid item>
                <motion.img
                    src={require('./flamingo 1.png')}
                    alt="world 5"
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    className="draggable image-context"
                    transition={{ duration: 3}}
                />
              </Grid>
              <Grid item>
                <motion.img
                    src={require('./cup.png')}
                    alt="world 5"
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    className="draggable image-context"
                    transition={{ duration: 2 }}
                />
              </Grid>
            </Grid>

            {/* Centered Text */}
             <Grid justifyContent="center" item>
              <Typography sx={{
                  fontFamily:"Monsieur La Doulaise",
                  fontSize:"5em",
                  fontWeight:"400"
                }}
                className="cedarville-cursive-regula" variant="h2" align="center">
                  Jade & Seka
              </Typography>
            </Grid>

            <Grid container direction="row" justifyContent="center" spacing={4}>
              <Grid item>
                  <img className="draggable image-context" src={require('./pinkflamingo.png')} alt="flamingo 4" />
              </Grid>
               <Grid item>
                  <img className="draggable image-context" src={require('./58536.png')} alt="flamingo 4" />
              </Grid>
            </Grid>

            {/* Bottom three images */}
            <Grid container direction="row" marginTop={-8} justifyContent="center" spacing={4}>
               <Grid item>
                <Button onClick={this.openModal} sx={{backgroundColor:"#2C3607", color:"white"}}>RSVP</Button>
              </Grid>
            </Grid>
          </Grid>
          {this.state.isModalOpen && <ModalComponent open={this.state.isModalOpen} onClose={this.closeModal}>
            <Typography variant="h6" id="modal-title">
              Modal Title
            </Typography>
            <Typography id="modal-description">
              This is the modal content.
            </Typography>
         </ModalComponent>}
      </div>
    );
  }
}


export default HomePage;
